import React,{useNavigation} from 'react';
// import  from 'react-router-dom';
import './BusBooking.css'; // Styles for glassmorphism effect

const BusBooking = () => {
  const history = useHistory();

  const handleBooking = () => {
    // Handle booking logic here, for now, just navigate to Home
    history.push('/Home');
  };

  return (
    <div className="bus-booking-container">
      <div className="bus-card">
        <img src="bus_image.jpg" alt="Bus" className="bus-image" />
        <div className="bus-details">
          <h2>Bus Name</h2>
          <p>Details about the bus...</p>
          <button className="book-button" onClick={handleBooking}>
            Book Now
          </button>
        </div>
      </div>
      {/* More bus cards can be added similarly */}
    </div>
  );
};

export default BusBooking;
